/* create table statements  */

/* table for user login information*/

CREATE TABLE IF NOT EXISTS public."login"
(
    id serial NOT NULL,
    username character varying(32) COLLATE pg_catalog."default" NOT NULL,
    password character varying(256) COLLATE pg_catalog."default" NOT NULL,
    email character varying(128) COLLATE pg_catalog."default" NOT NULL,
    uuid uuid NOT NULL,
    CONSTRAINT "Login_pkey" PRIMARY KEY (id),
    CONSTRAINT unique_username UNIQUE (username)
)

/* trable to track user history searches */

CREATE TABLE IF NOT EXISTS public."history"
(
    history_id serial NOT NULL,
    user_id int NOT NULL,
    username VARCHAR(50) NOT NULL,
	item_searched VARCHAR(100) NOT NULL,
	db_used VARCHAR(50) NOT NULL,
	search_results int NOT NULL,
    date VARCHAR(100) NOT NULL,
    uuid uuid NOT NULL,
	FOREIGN KEY (user_id) REFERENCES login(id),
    PRIMARY KEY (history_id)
)

/* table for vehicles */

create table public."vehicle" (
	id serial NOT NULL,
	year VARCHAR(50),
	brand VARCHAR(50),
	model VARCHAR(50),
	colour VARCHAR(50),
	vin VARCHAR(50),
	cost VARCHAR(50),
	country VARCHAR(50),
	city VARCHAR(50),
	address VARCHAR(50),
	PRIMARY KEY (id)
);

/* some basic sql statements  */

select * from login;
select * from history;
select * from vehicle;

delete from login where id = 14;

UPDATE login SET username = "garry" WHERE id= 10;
update login set username='gary' where id = 10;

/* some statements to show relation ships and joins */

/* displays the history list while also showing the users email, as well as getting rid of less important data  */

select l.username, l.email, h.item_searched, h.db_used, h.search_results from login l, history h
where h.user_id = l.id;

/* displays all the history logs from the user with id == 1   */

select l.username, l.email, h.item_searched, h.db_used, h.search_results from login l, history h
where h.user_id = l.id
and l.id = 1;

/* displays who search for a certain keyword and how many times they search for it  */

select l.id, l.username, l.email, h.item_searched, h.db_used, h.date from login l, history h
where h.user_id = l.id
and h.item_searched = 'bmw';


/* This is the query statement used in the final code to search for a keyword and find matches across all fields */

select * from vehicle
where to_tsvector(year || ' ' || brand || ' ' || model || ' ' || colour || ' ' || country || ' ' || city || ' ' || address) @@ to_tsquery('male');

